{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/pyaesonewaiyan/aviation-accidents-history?scriptVersionId=94243317\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"3a0ac5f7","metadata":{"papermill":{"duration":0.009437,"end_time":"2022-04-28T13:31:58.855136","exception":false,"start_time":"2022-04-28T13:31:58.845699","status":"completed"},"tags":[]},"source":["# About Dataset\n","\n","An aviation accident is defined by the Convention on International Civil Aviation Annex 13 as an occurrence associated with the operation of an aircraft, which takes place from the time any person boards the aircraft with the intention of flight until all such persons have disembarked, and in which a) a person is fatally or seriously injured, b) the aircraft sustains significant damage or structural failure, or c) the aircraft goes missing or becomes completely inaccessible.Annex 13 defines an aviation incident as an occurrence, other than an accident, associated with the operation of an aircraft that affects or could affect the safety of operation\n","\n","A hull loss occurs if an aircraft is damaged beyond repair, lost, or becomes completely inaccessible.\n","\n","Accident Categories:\n","\n","* A = Accident\n","* I = Incident\n","* H = Hijacking\n","* C = Criminal occurrence (sabotage, shoot down)\n","* O= other occurrence (ground fire, sabotage)\n","* U= type of occurrence unknown\n","\n","* 1 = hull-loss\n","* 2 = repairable damage"]},{"cell_type":"code","execution_count":1,"id":"d6b5ecf2","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-04-28T13:31:58.877355Z","iopub.status.busy":"2022-04-28T13:31:58.874177Z","iopub.status.idle":"2022-04-28T13:32:00.337664Z","shell.execute_reply":"2022-04-28T13: